__NUXT_JSONP__("/drugs/Fosbretabulin", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"222030-63-9",chebiId:"",chemicalFormula:"C18H21O8P",definition:"A water-soluble prodrug derived from the African bush willow (Combretum caffrum) with antineoplastic activity. Fosbretabulin is dephosphorylated to its active metabolite, combretastatin A4, which binds to tubulin and inhibits microtubule polymerization, resulting in mitotic arrest and apoptosis in endothelial cells. As apoptotic endothelial cells detach from their substrata, tumor blood vessels collapse; the acute disruption of tumor blood flow may result in tumor necrosis.",fdaUniiCode:"I5590ES2QZ",identifier:"C82378",preferredName:a,semanticType:"Organic Chemical",subclassOf:["C67421"],synonyms:["2-Methoxy-5-((1Z)-2-(3,4,5-trimethoxyphenyl)ethenyl)phenyl Phosphate","Combretastatin A-4 Phosphate","FOSBRETABULIN",a,"Phenol, 2-methoxy-5-((1Z)-2-(3,4,5-trimethoxyphenyl)ethenyl)-, Dihydrogen Phosphate"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FFosbretabulin",extension:".json",createdAt:b,updatedAt:b}}],fetch:{},mutations:void 0}}("Fosbretabulin","2021-10-30T13:45:54.473Z")));